export function organizePlaylist(arrayObj, type) {
  if (type === 0) return arrayObj;

  if (type === 1) {
    return arrayObj.sort((a, b) => { return a.valence - b.valence; });
  }

  if (type === 2) {
    return arrayObj.sort((a, b) => { return b.valence - a.valence; });
  }

  if (type === 3 || type === 4) {
    let first = [];
    let second = [];
    arrayObj.sort((a, b) => {
      return a.valence - b.valence;
    });
    arrayObj.forEach((obj, i) => {
      if (i % 2 === 0) {
        first.push(obj);
      } else {
        second.push(obj);
      }
    });
    if (type === 3) {
      return first.reverse().concat(second);
    }
    if (type === 4) {
      return first.concat(second.reverse());
    }
  }
  if (type === 5 || type === 6) {
    let first = [];
    let second = [];
    let third = [];
    let fourth = [];
    arrayObj.sort((a, b) => {
      return a.valence - b.valence;
    });
    arrayObj.forEach((obj, i) => {
      if (i % 4 === 0) {
        first.push(obj);
      } else if (i % 4 === 1) {
        second.push(obj);
      } else if (i % 4 === 2) {
        third.push(obj);
      } else if (i % 4 === 3) {
        fourth.push(obj);
      }
    });
    if (type === 5) {
      return first.reverse().concat(second, third.reverse(), fourth);
    }
    if (type === 6) {
      return first.concat(second.reverse(), third, fourth.reverse());
    }
  }
}

